(4, 'Advertising Rates', 'advertising-rates', 1, '<p><b>Please find our advertising rate table below. Each visitor you will purchase will meet the following criteria:</b></p>\n\n<ul>\n    <li>Unique within a 24 hour time frame</li>\n    <li>They will have JavaScript enabled</li>\n    <li>They will have Cookies enabled</li>\n    <li>Must view your website for at least 5 seconds</li>\n</ul>\n<p><b>You may receive traffic that does not meet this criteria, but you will never be charged for it.</b></p>\n\n[advertising_rates]\n\n<p>All sites are allowed, except when they contain:</p>\n\n<ul>\n    <li>Frame breaking script</li>\n    <li>Popup any windows on entry or exit of any kind</li>\n    <li>Automatically attempt to download software or change any user settings</li>\n    <li>Adult or Pornographic related</li>\n    <li>Hate, Bigotry, and/or IntoleranceWarez or Software Piracy related</li>\n    <li>Music Piracy RelatedHacking Related</li>\n    <li>Anything related to illegal activity</li>\n</ul>\n\n<p>Please contact us first if you are unsure whether your advertising would be suitable.</p>', '', NULL, '2025-11-30 03:17:46', '2025-11-30 03:17:46'),
(5, 'Publisher Rates', 'payout-rates', 1, '[payout_rates]', '', NULL, '2025-11-30 03:17:46', '2025-11-30 03:17:46');

